import Fundo from "./Fundo";
export default function fundos({ children: investments }) {
  console.log(investments);
  return (
    <div>
      <h2>{investments.length}</h2>
      {investments.map((invest) => {
        <Fundo>{invest.description}</Fundo>;
      })}
    </div>
  );
}
